    it('/users', () => {
      const data = {
        email: `test-${Math.floor(Math.random() * 9999)}@faxada.com.br`,
        name: 'Test name',
        gender: 'male',
        status: 'inactive',
      };

      return request
        .post('users')
        .set('Authorization', `Bearer ${TOKEN}`)
        .send(data)
        .then((res) => {
          expect(res.body).to.deep.include(data);
          userId = res.body.id;
        });
    });


  })

  describe('GET', () => {
