      return request
        .put(`users/${userId}`)
        .set('Authorization', `Bearer ${TOKEN}`)
        .send(data)
        .then((res) => {          
          expect(res.body).to.deep.include(data);
        });
    });

  })

  describe('DELETE', () => {
    it('users/:id', () => {
      return request
        .delete(`users/${userId}`)
        .set('Authorization', `Bearer ${TOKEN}`)
        .then((res) => {        
          expect(res.statusCode).to.be.eq(204);
        });
    });

  })
})

